@larocheposayusa Originally created in 1905 now more than 100 years later, the La Roche-Posay Thermal Center has become Europe’s leading thermal center for dermatology, opening their doors to those experiencing skin-related side effects of cancer treatment since 2009. I wish more companies would recognize and honor those affected by cancer. I’m so happy this conscious brand exists and creates affordable dermatologist approved formulas. The key to remaining youthful starts from within and by maintaining a great skin care routine. Cheers to a healthy skin microbiome! 

